import { Button, Stack, Nav, Navbar, NavDropdown, Form, InputGroup, Container, Row, Col } from 'react-bootstrap';
import '../css/layout.css';
import 'bootstrap/dist/css/bootstrap.min.css';

function Footer() {
    return(
        <Container>
            <Row>
                <Col xs={3}>1 of 2</Col>
                <Col xs={9}>2 of 2</Col>
            </Row>
        </Container>
    )
}

export default Footer;
